import React, { useState } from "react";
import { IoSearchOutline } from "react-icons/io5";
import { AnimatePresence } from "framer-motion";
import Hider from "../../../../utilsComponents/Hider/Hider";
import "./SearchBar.sass";

const SearchBar = () => {
  const [showSearch, setShowSearch] = useState();
  const handleShowSearch = () => {
    setShowSearch(!showSearch);
  };
  return (
    <>
      <div className="search_bar_container" onClick={handleShowSearch}>
        <div className="placeholder">Search here...</div>
        <div className="icon">
          <IoSearchOutline />
        </div>
      </div>
      <AnimatePresence>{showSearch && <Hider onClick={handleShowSearch}>PopopoPopopopopopopo</Hider>}</AnimatePresence>
    </>
  );
};

export default SearchBar;
